01) PROVIDENCIAR A REGULARIZAÇÃO DO CADASTRO (INSCRIÇÃO MUNICIPAL) DA RAZÃO SOCIAL ACIMA JUNTO A PREFEITURA MUNICIPAL DE ANÁPOLIS;
02) SOLICITAR A INCLUSÃO DA ATIVIDADE ECONÔMICA SECUNDÁRIA ATIVIDADES DE ASSISTENCIA A DEFICIENTES FISICOS, IMUNODEPRIMIDOS E CONVALESCENTES (CNAE 8711-5/03) TANTO NO CARTÃO CNPJ DA RAZÃO SOCIAL DA ENTIDADE QUANTO NO CADASTRO/INSCRIÇÃO MUNICIPAL A SER REGULARIZADO JUNTO A PREFEITURA MUNICIPAL.
